/**
Check the current wallet for vulnerabilities

@method checkForVulnerableWallet
*/
var checkForVulnerableWallet = function(wallet) {
  if (
    !wallet.address ||
    (wallet.vulnerabilities &&
      typeof wallet.vulnerabilities['txorigin'] !== 'undefined')
  )
    return;

  web3.eth.getCode(wallet.address, function(err, code) {
    if (!err) {
      if (code.length > 2) {
        var vulnerable = false;
        // test against vulnerable code

        var vulnerableFull = !!_.find(vulnerableWallets.full, function(
          vulnCode
        ) {
          return code === vulnCode;
        });
        var vulnerableStub = !!_.find(vulnerableWallets.stub, function(
          vulnCode
        ) {
          return code === vulnCode;
        });
        var vulnerableStubDynamic = !!_.find(
          vulnerableWallets.stubDynamic,
          function(vulnCode) {
            var regEx = new RegExp(
              vulnCode.replace(
                'cafecafecafecafecafecafecafecafecafecafe',
                '[a-z0-9]{40}'
              ),
              'i'
            );
            return regEx.test(code);
          }
        );

        if (vulnerableFull || vulnerableStub || vulnerableStubDynamic) {
          vulnerable = true;

          EthElements.Modal.question(
            {
              text: TAPi18n.__(
                'wallet.app.warnings.txOriginVulnerabilityPopup'
              ),
              ok: function() {
                FlowRouter.go('/account/' + wallet.address);
              },
              cancel: true,
              modalQuestionOkButtonText: TAPi18n.__(
                'wallet.app.warnings.checkThisNow'
              ),
              modalQuestionCancelButtonText: TAPi18n.__(
                'wallet.app.warnings.checkThisLater'
              )
            },
            { closeable: false }
          );
        }

        // update wallet contract
        Wallets.update(wallet._id, {
          $set: {
            vulnerabilities: {
              txorigin: vulnerable
            }
          }
        });
      }
    }
  });
};

/**
Created radom 32 byte string

@method random32Bytes
*/
var random32Bytes = function() {
  function s4() {
    return Math.floor((1 + Math.random()) * 0x10000)
      .toString(16)
      .substring(1);
  }
  return (
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4() +
    s4()
  );
};

/**
Update the contract data, like dailyLimit and required signatures.

@method updateContractData
*/
updateContractData = function(newDocument) {
  var contractInstance = contracts['ct_' + newDocument._id];

  if (!contractInstance) {
    return;
  }

  if (!contractInstance.options.address) {
    if (contractInstance.address) {
      contractInstance.options.address = contractInstance.address;
    } else {
      console.error('No contract address for contract', contractInstance);
      return;
    }
  }

  contractInstance.methods
    .m_dailyLimit()
    .call()
    .then(function(result) {
      Wallets.update(newDocument._id, {
        $set: {
          dailyLimit: result.toString(10)
        }
      });
      return null;
    });

  contractInstance.methods
    .m_required()
    .call()
    .then(function(result) {
      Wallets.update(newDocument._id, {
        $set: {
          requiredSignatures: result.toString(10)
        }
      });
      return null;
    });

  // UPDATE THE DAILYLIMITSPENT
  if (newDocument.version >= 1) {
    contractInstance.methods
      .m_spentToday()
      .call()
      .then(function(spent) {
        contractInstance.methods
          .m_lastDay()
          .call()
          .then(function(lastDay) {
            if (spent && _.isFinite(spent.toString(10))) {
              var now = new Date();
              var fullDaysSinceEpoch = Math.floor(now / 8.64e7);

              // update the daily limit, when its still the same day
              Wallets.update(newDocument._id, {
                $set: {
                  dailyLimitSpent:
                    fullDaysSinceEpoch === Number(lastDay)
                      ? spent.toString(10)
                      : '0'
                }
              });
            }
          });
        return null;
      });
  }

  // check if the owner changed
  checkOwner(newDocument);

  // check for version
  if (_.isUndefined(newDocument.version) && newDocument.address) {
    contractInstance.methods
      .version()
      .call()
      .then(function(version) {
        if (version.toString(10)) {
          // var sha3 = web3.sha3(code, true);

          // // find version
          // index = 0;
          // _.find(contractVersions, function(contract, i){
          //     if(contract.original === sha3 || contract.stub === sha3) {
          //         index = i;
          //         return true;
          //     } else
          //         return false;
          // });

          Wallets.update(newDocument._id, {
            $set: {
              version: Number(version)
            }
          });
          newDocument.version = Number(version);
        }
        return null;
      });
  }
};

/**
Update the owner list

@method checkOwner
*/
checkOwner = function(newDocument) {
  // check if the owners have changed
  if (web3.utils.isAddress(newDocument.address)) {
    checkWalletOwners(newDocument.address).then(
      function(wallet) {
        Wallets.update(newDocument._id, { $set: { owners: wallet.owners } });
        return null;
      },
      function() {}
    );
  }
};

/**
Update the pending confirmations with either adding or removing the owner.

It will check first if the incoming log is newer than the already stored data.

@method confirmOrRevoke
@param {Object} log
*/
confirmOrRevoke = function(contract, log) {
  var confirmationId = Helpers.makeId('pc', log.returnValues.operation);

  if (!confirmationId) return;

  contract.hasConfirmed(
    log.returnValues.operation,
    log.returnValues.owner,
    function(e, res) {
      var pendingConf = PendingConfirmations.findOne(confirmationId),
        setDocument = {
          $set: {
            from: log.address
          }
        };

      // remove the sending property
      if (pendingConf && pendingConf.sending === log.returnValues.owner)
        setDocument['$unset'] = { sending: '' };

      Helpers.eventLogs(
        'CHECK OPERATION: ' +
          log.returnValues.operation +
          ' owner: ' +
          log.returnValues.owner,
        res
      );

      if (res) {
        if (pendingConf)
          setDocument['$addToSet'] = {
            confirmedOwners: log.returnValues.owner
          };
        else setDocument['$set'].confirmedOwners = [log.returnValues.owner];
      } else {
        if (pendingConf)
          setDocument['$pull'] = { confirmedOwners: log.returnValues.owner };
        else setDocument['$set'].confirmedOwners = [];
      }

      PendingConfirmations.upsert(confirmationId, setDocument);
    }
  );
};

/**
Creates subscription for a wallet contract, to watch for deposits, pending confirmations, or contract creation events.

@method setupContractSubscription
@param {Object} newDocument
@param {Boolean} checkFromCreationBlock
*/
var setupContractSubscription = function(newDocument, checkFromCreationBlock) {
  var blockToCheckBack =
    (newDocument.checkpointBlock || 0) - ethereumConfig.rollBackBy;

  if (checkFromCreationBlock || blockToCheckBack < 0)
    blockToCheckBack = newDocument.creationBlock;

  var contractInstance = contracts['ct_' + newDocument._id];
  if (!contractInstance) return;

  if (!contractInstance.walletEvents) contractInstance.walletEvents = [];

  var events = contractInstance.walletEvents;

  // stop all running events
  _.each(contractInstance.walletEvents, function(event) {
    event.unsubscribe();
    contractInstance.walletEvents.shift();
  });

  // WATCH for the created event, to get the creation block
  if (newDocument.imported) {
    Helpers.eventLogs(
      'Imported wallet: ' +
        newDocument.address +
        ' checking for any log from block #' +
        newDocument.creationBlock
    );
    web3.eth.subscribe(
      'logs',
      {
        address: newDocument.address,
        fromBlock: newDocument.creationBlock
      },
      function(error, logs) {
        if (!error) {
          var creationBlock = EthBlocks.latest.number;

          // get earliest block number of appeared log
          if (logs.length !== 0) {
            logs.forEach(function(log) {
              if (log.blockNumber < creationBlock)
                creationBlock = log.blockNumber;
            });
          }

          // add the address state
          Wallets.update(newDocument._id, {
            $unset: {
              imported: ''
            },
            $set: {
              creationBlock: creationBlock - 100
            }
          });
          newDocument = Wallets.findOne(newDocument._id);

          // update dailyLimit and requiredSignatures
          updateContractData(newDocument);

          // add contract subscriptions
          setupContractSubscription(newDocument, true);
        }
      }
    );

    // CHECK if for the contract address
  } else if (!newDocument.address) {
    Helpers.eventLogs(
      'Contract address not set, checking for contract receipt'
    );
    web3.eth.getTransactionReceipt(newDocument.transactionHash, function(
      error,
      receipt
    ) {
      if (error) {
        console.log('Error from observeWallets getTransactionReceipt: ', error);
        return;
      }

      if (receipt) {
        if (!receipt.contractAddress) {
          console.log(
            'No contract address for transaction hash: ',
            newDocument.transactionHash
          );
          return;
        }

        web3.eth.getCode(receipt.contractAddress, function(error, code) {
          Helpers.eventLogs('Contract created on ' + receipt.contractAddress);

          if (!error && code.length > 2) {
            // add the address state
            Wallets.update(newDocument._id, {
              $set: {
                creationBlock: receipt.blockNumber,
                address: receipt.contractAddress
              }
            });
            newDocument = Wallets.findOne(newDocument._id);

            // set address to the contract instance
            WalletContract.options.address = receipt.contractAddress;
            WalletContract.address = receipt.contractAddress; // maintaining legacy value for code elsewhere
            contracts['ct_' + newDocument._id] = WalletContract;

            // add contract subscription
            setupContractSubscription(newDocument);

            // check for vulnerability
            checkForVulnerableWallet(newDocument);
          } else {
            Helpers.eventLogs(
              'Contract created on ' +
                receipt.contractAddress +
                ", but didn't stored the code!"
            );

            // remove account, if something failed
            Wallets.remove(newDocument._id);
          }
        });
      }
    });

    // ADD SUBSCRIPTION
  } else {
    // SETUP SUBSCRIPTION
    Helpers.eventLogs(
      'Checking Deposits and ConfirmationNeeded for ' +
        contractInstance.options.address +
        ' (_id: ' +
        newDocument._id +
        ') from block #',
      blockToCheckBack
    );

    // delete the last tx and pc until block -500
    _.each(
      Transactions.find({
        _id: { $in: newDocument.transactions || [] },
        blockNumber: { $exists: true, $gt: blockToCheckBack }
      }).fetch(),
      function(tx) {
        if (tx) Transactions.remove({ _id: tx._id });
      }
    );
    _.each(
      PendingConfirmations.find({
        from: newDocument.address,
        blockNumber: { $exists: true, $gt: blockToCheckBack }
      }).fetch(),
      function(pc) {
        if (pc) PendingConfirmations.remove({ _id: pc._id });
      }
    );

    var subscription = contractInstance.events.allEvents({
      fromBlock: blockToCheckBack,
      toBlock: 'latest'
    });
    events.push(subscription);

    // get past logs, to set the new blockNumber
    var currentBlock = EthBlocks.latest.number;
    contractInstance.getPastEvents(
      'allEvents',
      { fromBlock: blockToCheckBack },
      function(error, logs) {
        if (!error) {
          // update last checkpoint block
          Wallets.update(
            { _id: newDocument._id },
            {
              $set: {
                checkpointBlock:
                  (currentBlock || EthBlocks.latest.number) -
                  ethereumConfig.rollBackBy
              }
            }
          );
        }
      }
    );

    subscription.on('error', function(error) {
      console.error(
        'Logs of Wallet ' + newDocument.name + " couldn't be received",
        error
      );
    });

    subscription.on('data', function(log) {
      Helpers.eventLogs(log);

      if (
        EthBlocks.latest.number &&
        log.blockNumber > EthBlocks.latest.number
      ) {
        // update last checkpoint block
        Wallets.update(
          { _id: newDocument._id },
          {
            $set: {
              checkpointBlock: log.blockNumber
            }
          }
        );
      }

      if (log.event === 'Deposit') {
        if (log.removed) {
          Transactions.remove({
            _id: Helpers.makeId('tx', log.transactionHash)
          });
          return;
        }

        Helpers.eventLogs(
          'Deposit for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          Number(log.returnValues.value)
        );

        var txExists = addTransaction(
          log,
          log.returnValues.from,
          newDocument.address,
          log.returnValues.value.toString(10)
        );

        // NOTIFICATION
        if (!txExists || !txExists.tokenId) {
          var txId = Helpers.makeId('tx', log.transactionHash);

          Helpers.showNotification(
            'wallet.transactions.notifications.incomingTransaction',
            {
              to: Helpers.getAccountNameByAddress(newDocument.address),
              from: Helpers.getAccountNameByAddress(log.returnValues.from),
              amount: EthTools.formatBalance(
                log.returnValues.value,
                '0,0.00[000000] unit',
                'ether'
              )
            },
            function() {
              // on click show tx info
              EthElements.Modal.show(
                {
                  template: 'views_modals_transactionInfo',
                  data: {
                    _id: txId
                  }
                },
                {
                  class: 'transaction-info'
                }
              );
            }
          );
        }
      }
      if (log.event === 'SingleTransact' || log.event === 'MultiTransact') {
        if (log.removed) {
          Transactions.remove({
            _id: Helpers.makeId('tx', log.transactionHash)
          });
          return;
        }

        Helpers.eventLogs(
          log.event +
            ' for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          Number(log.returnValues.value)
        );

        var txExists = addTransaction(
          log,
          newDocument.address,
          log.returnValues.to,
          log.returnValues.value.toString(10)
        );

        // NOTIFICATION
        if (!txExists || !txExists.tokenId) {
          var txId = Helpers.makeId('tx', log.transactionHash);

          Helpers.showNotification(
            'wallet.transactions.notifications.outgoingTransaction',
            {
              to: Helpers.getAccountNameByAddress(log.returnValues.to),
              from: Helpers.getAccountNameByAddress(newDocument.address),
              amount: EthTools.formatBalance(
                log.returnValues.value,
                '0,0.00[000000] unit',
                'ether'
              )
            },
            function() {
              // on click show tx info
              EthElements.Modal.show(
                {
                  template: 'views_modals_transactionInfo',
                  data: {
                    _id: txId
                  }
                },
                {
                  class: 'transaction-info'
                }
              );
            }
          );
        }
      }
      if (log.event === 'ConfirmationNeeded') {
        Helpers.eventLogs(
          'ConfirmationNeeded for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues.value.toNumber() +
            ', Operation ' +
            log.returnValues.operation
        );

        web3.eth.getBlock(log.blockNumber, true, function(err, block) {
          if (!err && block) {
            var confirmationId = Helpers.makeId(
                'pc',
                log.returnValues.operation
              ),
              accounts = Wallets.find({
                $or: [
                  { address: log.address },
                  { address: log.returnValues.to }
                ]
              }).fetch(),
              pendingConf = PendingConfirmations.findOne(confirmationId);

            // PREVENT SHOWING pending confirmations, of WATCH ONLY WALLETS
            if (
              !(from = Wallets.findOne({ address: log.address })) ||
              !EthAccounts.findOne({ address: { $in: from.owners } })
            )
              return;

            // add pending confirmation,
            PendingConfirmations.upsert(confirmationId, {
              $set: {
                confirmedOwners: pendingConf ? pendingConf.confirmedOwners : [],
                initiator: log.returnValues.initiator,
                operation: log.returnValues.operation,
                value: log.returnValues.value.toString(10),
                to: log.returnValues.to,
                from: newDocument.address,
                timestamp: block.timestamp,
                blockNumber: log.blockNumber,
                blockHash: log.blockHash,
                transactionHash: log.transactionHash,
                transactionIndex: log.transactionIndex
              }
            });

            // NOTIFICATION
            if (pendingConf && !pendingConf.operation) {
              Helpers.showNotification(
                'wallet.transactions.notifications.pendingConfirmation',
                {
                  initiator: Helpers.getAccountNameByAddress(
                    log.returnValues.initiator
                  ),
                  to: Helpers.getAccountNameByAddress(log.returnValues.to),
                  from: Helpers.getAccountNameByAddress(newDocument.address),
                  amount: EthTools.formatBalance(
                    log.returnValues.value,
                    '0,0.00[000000] unit',
                    'ether'
                  )
                },
                function() {
                  FlowRouter.go('/account/' + newDocument.address);
                }
              );
            }

            // remove pending transactions, as they now have to be approved
            var extistingTxId = Helpers.makeId('tx', log.transactionHash);
            Meteor.setTimeout(function() {
              Transactions.remove(extistingTxId);
            }, 500);
          }
        });
      }
      if (log.event === 'OwnerAdded') {
        Helpers.eventLogs(
          'OwnerAdded for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues
        );

        checkOwner(newDocument);
      }
      if (log.event === 'OwnerRemoved') {
        Helpers.eventLogs(
          'OwnerRemoved for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues
        );

        checkOwner(newDocument);
      }
      if (log.event === 'RequirementChanged') {
        Helpers.eventLogs(
          'RequirementChanged for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues
        );
      }
      if (log.event === 'Confirmation') {
        Helpers.eventLogs(
          'Operation confirmation for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues
        );

        confirmOrRevoke(contractInstance, log);
      }
      if (log.event === 'Revoke') {
        Helpers.eventLogs(
          'Operation revokation for ' +
            newDocument.address +
            ' arrived in block: #' +
            log.blockNumber,
          log.returnValues
        );

        confirmOrRevoke(contractInstance, log);
      }
    });
  }
};

/**
Observe accounts and setup subscriptions

@method observeWallets
*/
observeWallets = function() {
  /**
    Checking for confirmations of created wallets.

    Will only check if the old document, has no address and its inside the confirmations still.

    @method checkWalletConfirmations
    @param {Object} newDocument
    @param {Object} oldDocument
    */
  var checkWalletConfirmations = function(newDocument, oldDocument) {
    var confirmations = EthBlocks.latest.number - newDocument.creationBlock;

    if (
      newDocument.address &&
      (!oldDocument || (oldDocument && !oldDocument.address)) &&
      confirmations < ethereumConfig.requiredConfirmations
    ) {
      var subscription = web3.eth
        .subscribe('newBlockHeaders')
        .on('data', function(blockHeader) {
          var confirmations =
            EthBlocks.latest.number - newDocument.creationBlock;

          if (
            confirmations < ethereumConfig.requiredConfirmations &&
            confirmations > 0
          ) {
            Helpers.eventLogs(
              'Checking wallet address ' +
                newDocument.address +
                ' for code. Current confirmations: ' +
                confirmations
            );

            // TODO make smarter?

            // Check if the code is still at the contract address, if not remove the wallet
            web3.eth.getCode(newDocument.address, function(e, code) {
              if (!e) {
                if (code.length > 2) {
                  updateContractData(newDocument);

                  // check for wallet data
                } else {
                  Wallets.remove(newDocument._id);
                  subscription.unsubscribe();
                }
              }
            });
          } else if (confirmations > ethereumConfig.requiredConfirmations) {
            subscription.unsubscribe();
          }
        });
    }
  };

  /**
    Observe Wallets, listen for new created accounts.

    @class Wallets.find({}).observe
    @constructor
    */
  collectionObservers[collectionObservers.length] = Wallets.find({}).observe({
    /**
        This will observe the account creation, to send the contract creation transaction.

        @method added
        */
    added: function(newDocument) {
      // DEPLOYED NEW CONTRACT
      if (!newDocument.address) {
        // tx hash already exisits, so just get the receipt and don't re-deploy
        if (newDocument.transactionHash) {
          contracts['ct_' + newDocument._id] = WalletContract;

          // remove account, if something is searching since more than 30 blocks
          if (newDocument.creationBlock + 50 <= EthBlocks.latest.number) {
            Wallets.remove(newDocument._id);
          } else {
            setupContractSubscription(newDocument);
          }

          return;
        }

        if (_.isEmpty(newDocument.owners)) {
          return;
        }

        // SAFETY

        // 1. check if stub code has a proper address
        if (
          newDocument.code.indexOf(
            'cafecafecafecafecafecafecafecafecafecafe'
          ) !== -1
        ) {
          GlobalNotification.error({
            content: TAPi18n.__(
              'wallet.newWallet.error.stubHasNoOrigWalletAddress'
            ),
            closeable: false
          });
          Wallets.remove(newDocument._id);
          return;
        }

        // 2. check if we are still on the right chain, before creating a wallet
        Helpers.checkChain(function(e) {
          if (e) {
            Wallets.remove(newDocument._id);

            GlobalNotification.error({
              content: TAPi18n.__('wallet.app.error.wrongChain', {
                Ethereum: publicSettings.Ethereum
              }),
              closeable: false
            });
            return;
          }

          console.log('Deploying Wallet with following options', newDocument);

          WalletContract.deploy({
            data: newDocument.code,
            arguments: [
              newDocument.owners,
              newDocument.requiredSignatures || 1,
              newDocument.dailyLimit || ethereumConfig.dailyLimitDefault
            ]
          })
            .send(
              {
                from: newDocument.deployFrom,
                gas: 3000000
              },
              function(error, transactionHash) {
                if (error) {
                  console.log('Error while deploying wallet', error);

                  GlobalNotification.error({
                    content: error.message,
                    duration: 8
                  });

                  // remove account, if something failed
                  Wallets.remove(newDocument._id);

                  return;
                }

                // add transactionHash to account
                newDocument.transactionHash = transactionHash;
                console.log('Contract transaction hash: ', transactionHash);

                Wallets.update(newDocument._id, {
                  $set: {
                    transactionHash: transactionHash
                  }
                });
              }
            )
            .on('receipt', function(receipt) {
              console.log('Contract receipt: ', receipt);
            })
            .then(function(contract) {
              // in upgrading to web3.js 1.0, the address resides in contract.options.address instead of contract.address
              // we'll set contract.address so the code remains functionining properly.
              contract.address = contract.options.address;

              console.log('Contract Address: ', contract.options.address);

              contracts['ct_' + newDocument._id] = contract;

              // add address to account
              Wallets.update(newDocument._id, {
                $set: {
                  creationBlock: EthBlocks.latest.number - 1,
                  checkpointBlock: EthBlocks.latest.number - 1,
                  address: contract.options.address
                },
                $unset: {
                  code: ''
                }
              });
              newDocument.address = contract.options.address;
              delete newDocument.code;

              updateContractData(newDocument);

              setupContractSubscription(newDocument);

              // Show backup note
              EthElements.Modal.question(
                {
                  template: 'views_modals_backupContractAddress',
                  data: {
                    address: contract.options.address
                  },
                  ok: true
                },
                {
                  closeable: false
                }
              );

              return null;
            });
        });
        // USE DEPLOYED CONTRACT
      } else {
        WalletContract.options.address = newDocument.address;
        contracts['ct_' + newDocument._id] = WalletContract;

        // update balance on start
        web3.eth.getBalance(newDocument.address, function(err, res) {
          if (!err) {
            Wallets.update(newDocument._id, {
              $set: {
                balance: res.toString(10)
              }
            });
          }
        });

        // check if wallet has code
        web3.eth.getCode(newDocument.address, function(e, code) {
          if (!e) {
            if (code && code.length > 2) {
              Wallets.update(newDocument._id, {
                $unset: {
                  disabled: ''
                }
              });

              // init wallet events, only if existing wallet
              updateContractData(newDocument);
              setupContractSubscription(newDocument);
              checkWalletConfirmations(newDocument, {});
            } else {
              Wallets.update(newDocument._id, {
                $set: {
                  disabled: true
                }
              });
            }
          } else {
            console.log("Couldn't check Wallet code of ", newDocument, e);
          }
        });

        // check for vulnerability
        checkForVulnerableWallet(newDocument);
      }
    },
    /**
        Will check if the contract is still there and update the today spend if a new tx is added

        @method changed
        */
    changed: function(newDocument, oldDocument) {
      // checkWalletConfirmations(newDocument, oldDocument);

      if (newDocument.transactions != oldDocument.transactions)
        updateContractData(newDocument);
    },
    /**
        Stop subscriptions, when accounts are removed

        @method removed
        */
    removed: function(newDocument) {
      var contractInstance = contracts['ct_' + newDocument._id];
      if (!contractInstance) return;

      if (!contractInstance.walletEvents) contractInstance.walletEvents = [];

      // stop all running events
      _.each(contractInstance.walletEvents, function(event) {
        event.unsubscribe();
        contractInstance.walletEvents.shift();
      });

      delete contracts['ct_' + newDocument._id];

      // delete the all tx and pending conf
      _.each(Transactions.find({ from: newDocument.address }).fetch(), function(
        tx
      ) {
        if (
          !Wallets.findOne({ transactions: tx._id }) &&
          !EthAccounts.findOne({ transactions: tx._id })
        )
          Transactions.remove(tx._id);
      });
      _.each(
        PendingConfirmations.find({ from: newDocument.address }).fetch(),
        function(pc) {
          PendingConfirmations.remove(pc._id);
        }
      );
    }
  });
};
